import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import styles from './RaiseRequest.module.css';

const RaiseRequest = () => {
  const [services, setServices] = useState([]);
  const [selectedService, setSelectedService] = useState('');
  const [description, setDescription] = useState('');
  const [message, setMessage] = useState('');
  const [isError, setIsError] = useState(false);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();
  const userId = localStorage.getItem('userId');

  useEffect(() => {
    axios.get('http://localhost:8080/api/services/available')
      .then(response => {
        // Ensure response.data is an array and has items
        if (Array.isArray(response.data)) {
          setServices(response.data);
        } else {
          setMessage('No services available');
          setIsError(true);
        }
        setLoading(false);
      })
      .catch(error => {
        setMessage('Failed to load services');
        setIsError(true);
        setLoading(false);
        console.error('Error fetching services:', error);
      });
  }, []);

  const handleServiceChange = (e) => {
    setSelectedService(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault(); // Prevent default form submission behavior
    
    if (!selectedService || !description.trim()) {
      setMessage('Please fill all fields');
      setIsError(true);
      setTimeout(() => setMessage(''), 3000);
      return;
    }

    const requestData = {
      serviceId: parseInt(selectedService),
      userId: parseInt(userId),
      description: description.trim(),
      status: "Pending"
    };

    axios.post('http://localhost:8080/api/requests', requestData)
      .then(response => {
        setSelectedService('');
        setDescription('');
        setIsError(false);
        setMessage('Request submitted successfully!');
        setTimeout(() => navigate('/userdashboard'), 2000);
      })
      .catch(error => {
        const errorMsg = error.response?.data?.message || 
                        error.response?.data?.error || 
                        'Failed to submit request';
        setMessage(errorMsg);
        setIsError(true);
        console.error('Submission error:', error);
      });
  };

  if (loading) return <div className={styles.loading}>Loading services...</div>;

  return (
    <div className={styles.container}>
      <h2>Raise New Request</h2>
      
      {message && (
        <div className={isError ? styles.error : styles.success}>
          {message}
        </div>
      )}
      
      <form onSubmit={handleSubmit}>
        <div className={styles.formGroup}>
          <label htmlFor="service-select">Select Service:</label>
          <select
            id="service-select"
            value={selectedService}
            onChange={handleServiceChange}
            required
            className={styles.select}
          >
            <option value="">-- Select a service --</option>
            {services.map(service => (
              <option 
                key={service.serviceId} 
                value={service.serviceId.toString()} // Ensure value is string
              >
                {service.serviceName}
              </option>
            ))}
          </select>
        </div>
        
        <div className={styles.formGroup}>
          <label htmlFor="description">Description:</label>
          <textarea
            id="description"
            value={description}
            onChange={(e) => setDescription(e.target.value)}
            placeholder="Describe your request..."
            required
            className={styles.textarea}
          />
        </div>
        
        <div className={styles.buttonGroup}>
          <button type="submit" className={styles.submitButton}>
            Submit Request
          </button>
          <button 
            type="button" 
            onClick={() => navigate('/userdashboard')}
            className={styles.cancelButton}
          >
            Cancel
          </button>
        </div>
      </form>
    </div>
  );
};

export default RaiseRequest;
